import React from 'react';
import './App.css';

// Components
import {
  Container,
  Card,
  CardHeader,
  CardBody,
  Form,
  FormGroup,
  Label,
  Col,
  Input
} from 'reactstrap';

function App() {
  return (
    <Container style={{
      maxWidth: 900,
      margin: '0 auto',
      padding: '50px 0',
    }}>
      <Card>
        <CardHeader>
          <h1>CPF and CNPJ Mask</h1>
        </CardHeader>
        <CardBody>
          <Form>
            <FormGroup row>
              <Label for="exampleEmail" sm={2}>Email</Label>
              <Col sm={10}>
                <Input type="email" name="email" id="exampleEmail" placeholder="with a placeholder" />
              </Col>
            </FormGroup>
          </Form>
        </CardBody>
      </Card>
    </Container>
  );
}

export default App;
